String.prototype.define("hashCode", function() {
    var hash = 0;
    if (this.length == 0) {
        return hash;
    }
    for (var i = 0; i < this.length; i++) {
        var char = this.charCodeAt(i);
        hash = ((hash<<5)-hash)+char;
        hash = hash & hash; 
    }
    return hash;
})
Array.prototype.define("compress", function() {
    var original = this, compressed = []
    for (var i = 0; i < original.length; i++) {
        if (!compressed[original[i]]) {
            compressed[original[i]] = [original[i], 1]
        }
        else {
            compressed[original[i]][1]++
        }
    }
    for (var i = 1; i < 10; i++) {
        if (!compressed[i]) {
            compressed[i] = [i+"", 0]
        }
    }
    return compressed.sort().clean()//.map(p => p.join())   
})
Array.prototype.define("clean", function(deleteValue) {
    for (var i = 0; i < this.length; i++) {
        if (this[i] == deleteValue) {           
            this.splice(i, 1);
            i--;
        }
    }
    return this;
})
function* generator(start = 0, end = Infinity, step = 1) {
    let n = 0;
    for (let i = start; i < end; i += step) {
        n += 1;
        yield i;
    }
    return n;
}
