function checkForSingle(squares) {
    var hasSingle = false
    for (let i of generator(0, 9)) {
        if (squares[i][1] === 1) {
            hasSingle = squares[i]
        }
    }
    return hasSingle
}
function checkForPairs(squares) {
    var pairs = []
    for (let i of generator(0, 9)) {
        if (getCandidates($(squares[i])).length === 2) {
            for (let j of generator(0, 9)) {
                if (i == j) continue
                if (getCandidates($(squares[j])).length === 2) {
                    if (getCandidates($(squares[i])).text() == getCandidates($(squares[j])).text()) {
                        pairs.push([squares[i], squares[j]])
                    }
                }
            }
        }
    }
    if (pairs.length) return Array.from(new Set(pairs))
}
