		$table.find("th").each(function() {
			ind = 0
			if ($(this).attr("rowspan")) {
				ind = Number.parseInt($(this).attr("rowspan"), 10)
				$(this).attr("rowspan", 1)
				ind = $(this).parents("table").find("tr").eq(ind-1)[0].insertCell($(this).index()+1)
			}
		})


		$table.find("th").click(function(e) {
			exp = parseInt($button.attr("export"), 10)
			$button.attr("export", exp+1)
			e.preventDefault()
			e.stopPropagation()
			$th = $(this)
			$th.toggleClass("export")

			var $acc = $th.prevAll().toArray().map(function(x) {
				if ($(x).attr("colspan")) {
				    return Number.parseInt($(x).attr("colspan"))
				}
				return 1
			})
			if ($acc.length) {
			    $acc = $acc.reduce(function(x, y) {return x + y})
			}
			$table.find("tr").each(function() {
				$(this).find("td").eq($acc).toggleClass("export")
			})
		})
	})
	$(document).on("click", ".export-button", function() {
		$table = $(this).next("table")
		var $table = $table.clone()
		var exp = parseInt($(this).attr("export"), 10)
		if (exp > 0) {
			$table.find("th:not(.export), td:not(.export)").remove()
		}
		var name = $(this).prevAll("h2").find(".mw-headline").text().replace(/ /g, "-").toLowerCase() || document.title
		name += ".csv"
		var content = $.map($table.find("tr"), function(a){
			return $.map($(a).find("th, td"), function(b) {
				return $(b).text().trim() || $(b).html()
			}).join(":").replace(/,/g, ';').replace('-\n', '').replace(/:/g, ',')
		}).join("\n")
		exportFile(name, content)
		$(".export").removeClass("export")
	})

})









function exportFile(name, content) {
	content = encodeURI("\uFEFF"+content)
	var a = document.createElement("a");
	a.setAttribute("target", '_blank');
	a.setAttribute("href", 'data:attachment/csv,' + content);
	a.setAttribute("download", name);
	a.click();
	document.body.appendChild(a);
}

var globalProps = [ ];

function readGlobalProps() {
    globalProps = Object.getOwnPropertyNames( window );
}

function findNewEntries() {
    var currentPropList = Object.getOwnPropertyNames( window );

    return currentPropList.filter( findDuplicate );

    function findDuplicate( propName ) {
        return globalProps.indexOf( propName ) === -1;
    }
}

